import Navbar from './Navbar';
import './Blog.css';
import { Link } from 'react-router-dom';


function Blog() {
  const blogs = [
    {
      id: 1,
      title: 'Mumbai',
      image: '/mumbai.jpeg',
      content: 'This is the content of the first blog...',
      shape: 'square',
    },
    {
      id: 2,
      title: 'Delhi',
      image: '/delhi.jpeg',
      content: 'This is the content of the second blog...',
      shape: 'square',
    },
        {
      id: 4,
      title: 'Goa',
      image: '/goa.jpeg',
      content: 'Explore a five day itenirary in Goa',
      shape: 'square',
    },
    {
      id: 5,
      title: 'Kashmir',
      image: '/kashmir.jpeg',
      content: 'This is the content of the second blog...',
      shape: 'square',
    },
    {
      id: 3,
      title: 'Kerela',
      image: '/kerela.jpeg',
      content: 'Explore a five day itenirary in Kerela',
      shape: 'square',
    },

    {
      id: 6,
      title: 'Gujarat',
      image: '/gujarat.jpeg',
      content: 'This is the content of the first blog...',
      shape: 'square',
    },
  ];

  return (
    <div>
      <Navbar />
    <div className="blog-container">
      {blogs.map((blog) => (
        <div key={blog.id} className={`blog ${blog.shape}`}>
          <h2>
            <Link to='/Blogs/{Blog.title}'>{blog.title}</Link>   
          </h2>
          <img src={blog.image} alt={blog.title} />
          <p>{blog.content}</p>
        </div>
      ))}
    </div>
    </div>
  );
}

export default Blog;
